import React from 'react';
import '../styles/portada.css';
import '../assets/wspp.svg';

function Portada() {
    return (
        <div className="portada-container">
            <div className="container-izq">

                <div className="nombre-info">
                    <h1>Kristin</h1>
                    <span>Barrera</span>
                </div>
            
                <div className="Cargo">
                    <div className="linea"
                    ></div> 
                    <div className="car">
                        <p>Diseñadora UX/UI</p>
                    </div>
                </div>


                <div className="boton-contacto">
                    <button className="contact-button">
                        <img src="src\assets\wspp.svg" alt="WhatsApp" className="icono-whatsapp" />
                        Contáctame
                    </button>
                </div>
            </div>
            <div className="imagen-derecha">
                {/* Aquí puedes agregar tu imagen */}
            </div>
        </div>
    );
}

export default Portada;
